description:
Nederland
Romantiek
85 minuten

geregisseerd door Mischa Kamp
met Anna Raadsveld, Benja Bruijning en Charlie Dagelet

Iedereen lijkt geobsedeerd door seks, behalve Belle, die gewoon viool wil spelen. Haar grootste droom is om ooit aan het conservatorium haar kunsten te vertonen. Belle vertrekt uit haar dorp, om in de stad haar droom na te leven. Hier komt ze er achter dat seks een positieve invloed heeft op haar vioolspel en realiseert ze zich dat ze de audities nooit zal halen zonder seksuele opwinding.

Vanaf 4 januari op video

